description:
Robot din plus moale.
Are la bazã principiile roboticii biomorfice ;
Buton “Try Me” pentru demonstratie sunete si miscãri ochi/gurã ;
Scoate sunete ce le imitã pe cele ale unui pui real si a cãror intensitate poate fi reglatã ;
Moale si usor de îndrãgit de cãtre copii ;
Gurã care se poate misca si ochi care clipesc ;
Senzori tactili pe cap si spate activati când puiul este mângâiat;
puiul va scânci si va mârâi ;
Senzor de înclinare, care îi permite sã stie dacã e în picioare sau culcat ;
Echipat cu un regim economic în care intrã, dacã nu e folosit mai mult de 5 minute ;
Trei pozitii ale butonului ON/OFF: ON „ Try me”, OFF si ON „Normal”;
Baterii necesare pentru pui : 4 baterii Alcaline Tip „AA” ( incluse) ;

Pui de leopard din plus moale usor de indragit de copii.

Are la bazã principiile roboticii biomorfice ;
Buton “Try Me” pentru demonstratie sunete si miscãri ochi/gurã ;
Scoate sunete ce le imitã pe cele ale unui pui real si a cãror
intensitate poate fi reglatã ;
